    constructor(login){
        if(login === localStorage.getItem('account')){
            this.IsMyAccount = true;
        }else{
            this.IsMyAccount = false;
        }
    }

    #getAccount(){
        const response = fetch(`http://localhost:4000/:${this.#IsMyAccount}`);
        const jsonData = response.json();
        const dataArr = Object.values(jsonData);
        return dataArr;
    }

    async getAccountMainInformation(){
        let dataArr = this.#getAccount();
        return(<table>
            <thead>
                <tr>
                    <th>
                        Account
                    </th>
                    <th>
                        Password
                    </th>
                </tr>
            </thead>
            <tbody>
                {dataArr.map(el => (
                    <tr>
